import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the cart modal (simulate clicking on the cart)
    // Try to find the cart element by class
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for the cart modal to appear (look for cartModal or cartItems)
    await page.waitForSelector('#cartModal, #cartItems', { timeout: 5000 });

    // Take screenshot of cart modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_open.png'));

    // Check if there are any items to remove
    // Try to find a "Remove" button in the cart
    const removeBtn = await page.$('.remove-item');
    let removedTitle = null;
    if (removeBtn) {
      // Extract the item title before removing
      const cartItemTitle = await page.$eval('.cart-item-title', el => el.textContent.trim());
      removedTitle = cartItemTitle;

      // Click the remove button
      await removeBtn.click();

      // Wait for the cart to update (either the item disappears or "empty cart" message appears)
      await page.waitForTimeout(500); // Short pause for UI update

      // Take screenshot after removal
      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_item_removed.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_item_removed.png'));

      // Extract cart state after removal
      let cartEmpty = false;
      let remainingTitles = [];
      const emptyCartEl = await page.$('.empty-cart');
      if (emptyCartEl) {
        cartEmpty = true;
      } else {
        // Get remaining cart item titles
        const titles = await page.$$eval('.cart-item-title', els => els.map(e => e.textContent.trim()));
        remainingTitles = titles;
      }

      return {
        success: true,
        action: "Removed an item from the cart",
        extractedData: {
          removedTitle,
          cartEmpty,
          remainingTitles
        },
        screenshots,
        error: null
      };
    } else {
      // No items to remove
      return {
        success: true,
        action: "No items found in cart to remove",
        extractedData: {
          removedTitle: null,
          cartEmpty: true,
          remainingTitles: []
        },
        screenshots,
        error: null
      };
    }
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
